    <h2>Pitanja i odgovori</h2>

    <div>
                    <div>
                                <h3>NekocBraca</h3>
                <div class="Post-body">
                    <p>Razmisljam da se prijavim za dom pa imam par pocetnickih pitanja.</p>

<ol style="list-style-type:decimal"><li>Ako dobijem neki dom, ali kasnije ipak odustanem od toga, jel mogu bez posljedica odustati? Do kojeg datuma?</li>
<li>U web obrascu trebam odabrati “Kategorija smjestaja” i “Kategorija smjestaja 2”. To su pretpostavljam preference za smjestaj? Jel ce mi uopce biti ponudjeni drugi smjestaji ako necu imati bodova za smjestaj u odabranim kategorijama?</li>
<li>Za vrijeme trajanja natjecaja nisam u Hrvatskoj, jel i dalje prijavu moram slati postom ili mislite da postoji nacin da to rijesim preko maila?</li></ol>


<p>Ako je bitno, ocekujem da cu imati malo bodova na natjecaju</p>
                </div>
            </div>

            <hr>
                    <div>
                                <h3>member</h3>
                <div class="Post-body">
                    <p><a href="5255.html" class="PostMention" data-id="221925">NekocBraca</a></p> 
<ol style="list-style-type:decimal"><li>Možeš odustat bilo kad. </li>
<li>Ako ne budeš imao dovoljno bodova za prva dva odabira, onda te stave di ima slobodnog mjesta. Eventualno zamoliš u upravi drugu kategoriju pa te prebace</li>
<li>Sve se šalje poštom.</li></ol>


<p>Definiraj “malo bodova” ili izračunaj sam pa vidi s kolko su bodova ljudi upadali prošle godine u koju kategoriju (imaš na njihovom webu). Ako ne skupiš dovoljno bodova za bilo koju kategoriju, onda te stave na listu čekanja jer se granica spušta kako odmiče akademska godina</p>
                </div>
            </div>

            <hr>
                    <div>
                                <h3>AntonioB25</h3>
                <div class="Post-body">
                    <p>koliko se otprilike čeka na rješenje molbe za ispis predmeta?</p> 
                </div>
            </div>

            <hr>
                    <div>
                                <h3>AntonioB25</h3>
                <div class="Post-body">
                    <p><a href="5257.html" class="PostMention" data-id="221940">Pleteni miš</a> 4-5 radnih dana</p>
                </div>
            </div>

            <hr>
                    <div>
                                <h3>viliml</h3>
                <div class="Post-body">
                    <p><a href="5253.html" class="PostMention" data-id="221920">BlackMamba</a> Čak i ako smo skroz završili preddiplomski, još uvijek pišemo preddiplomski jer nismo još upisali diplomski.</p>
                </div>
            </div>

            <hr>
                    <div>
                                <h3>Haki</h3>
                <div class="Post-body">
                    <p>Jel zna netko kad bi mogao biti rok za upis diplomskog i jel se treba dolazit fizicki na faks zbog upisa ili se sve rjesava online?</p>
                </div>
            </div>

            <hr>
                    <div>
                                <h3>Svudec</h3>
                <div class="Post-body">
                    <p><a href="5264.html" class="PostMention" data-id="222041">Haki</a> Tu kaže od danas (LOL) i da će se moć sve online.<br>
<a href="https://www.fer.unizg.hr/upis/diplomski/prijava" rel=" nofollow ugc">https://www.fer.unizg.hr/upis/diplomski/prijava</a></p>
                </div>
            </div>

            <hr>
                    <div>
                                <h3>deus_vult</h3>
                <div class="Post-body">
                    <p><a href="5265.html" class="PostMention" data-id="222058">Svudec</a> došlo je to za prijavu..al ne piše do kad treba predat</p>
                </div>
            </div>

            <hr>
                    <div>
                                <h3>RedJohn</h3>
                <div class="Post-body">
                    <p>Može li se obrazac A ovjeriti online?</p>
                </div>
            </div>

            <hr>
                    <div>
                                <h3>Filemon</h3>
                <div class="Post-body">
                    <p><a href="5267.html" class="PostMention" data-id="222074">deus_vult</a> naravno da piše <a href="https://www.fer.unizg.hr/studiji/diplomski_studiji/upisi" rel=" nofollow ugc">https://www.fer.unizg.hr/studiji/diplomski_studiji/upisi</a></p>
                </div>
            </div>

            <hr>
                    <div>
                                <h3>KingGeedorah</h3>
                <div class="Post-body">
                    <p>Gledam natječaj za dom i za članove obitelji piše:</p>

<blockquote class="uncited"><div><p>Članovima obitelji smatraju se braća i sestre predškolske dobi ili na redovitom školovanju koji ne žive na istom prebivalištu s obitelji, a nalaze se na školovanju, do završetka redovitog školovanja, najkasnije do navršene 26. godine života.</p></div></blockquote>

<p>Ako imam brata koji nije na istom prebivalištu i izvanredan je student, moram li ga navodit? Čini se da ne, ali pitam čisto da provjerim</p>
                </div>
            </div>

            <hr>
                    <div>
                                <h3>Tonii</h3>
                <div class="Post-body">
                    <p>Na rujanski razredbeni postupak prijavljuju se:</p>

<p>studenti FER-a koji će završiti preddiplomski studij ili namjeravaju završiti preddiplomski studij u rujnu 2021. godine;<br>
studenti koji su završili ili će završiti srodan sveučilišni preddiplomski studij na nekom drugom visokom učilištu;<br>
studenti koji iz objektivnih razloga nisu pristupili srpanjskom razredbenom postupku.<br>
Ako je meni ostao samo 1 rok za jesen ja se ne prijavljujem sada?</p>
                </div>
            </div>

            <hr>
                    <div>
                                <h3>deus_vult</h3>
                <div class="Post-body">
                    <p><a href="5270.html" class="PostMention" data-id="222120">Zulul</a> da tak i piše rujanski rok je msm u zadnjem tjednu rujna tj tjedan prije početka nastave..</p>
                </div>
            </div>

            <hr>
                    <div>
                                <h3>gladiator</h3>
                <div class="Post-body">
                    <p>Jel molbe za upis predmeta sa drugih smjerova na diplomskom vrijede samo za izborne predmete profila ili i za jezgrene predmete profila? Btw ko to sve mora potpisat i koliko cesto to prode tj. bude odobreno?</p> 
                </div>
            </div>

            <hr>
                    <div>
                                <h3>Tonii</h3>
                <div class="Post-body">
                    <p><a href="5272.html" class="PostMention" data-id="222129">deus_vult</a> A zapravo imam još jedno pitanje, samo za sigurnost jel trebam ja ovo sad ispunjavati ili tek na tom rujanskom roku?</p>
                </div>
            </div>

            <hr>

                </div>
            </div>

            <hr>

                <div class="Post-body">
                    <p>Koja je fora s ovom provjerom znanja koja se piše zbog upisa na diplomski studij i zašto ju pišu samo ovi s rujanskog upisa. Jel moguće tipa da neki smjer ne odobri studentu upis ako je imao premalo bodova ili neš?</p>
